import React from 'react';
import './OurCompany.css';

const OurCompany = () => {
    return (
        <div className="our-company">
            <div className="content-wrapper">
                {/* Background Video */}
                <video className="background-video" src="/images/aboutwrapper.mp4" autoPlay loop muted playsInline>
                    Your browser does not support the video tag.
                </video>

                {/* Content Overlay */}
                <div className="content-overlay">
                    <h1 className="title">Our Company</h1>
                    <h2 className="subtitle">About Us</h2>
                    <p className="description">
                        For nearly 3 decades, Paramount has been a trusted cybersecurity leader in the Middle East.
                    </p>
                </div>
            </div>
        </div>
    );
};

export default OurCompany;
